import React from 'react';
import './Footer.css';

interface FooterItemProps {
    imageUrl: string;
    text: string;
}

interface FooterProps {
    items: FooterItemProps[];
    bottomImageUrl: string;
    bottomText: string;
}

export default function Footer({ items, bottomImageUrl, bottomText }: FooterProps) {
    return (
        <footer className="footer">
            {/* Prima sezione */}
            {/* <div className="footer-top">
                {items.map((item, index) => (
                    <div key={index} className="footer-item">
                        <img src={item.imageUrl} alt={`Footer item ${index + 1}`} className="footer-item-image" />
                        <p className="footer-item-text">{item.text}</p>
                    </div>
                ))}
            </div> */}

            <div className='row'>
                <div className='col-sm'>
                    <i className="bi bi-pin-map-fill footer-first-section-image"> 
                        <p className='footer-first-section-text'>
                            DOVE SEGUO I MIEI CLIENTI
                       </p>
                       <iframe src="https://www.google.com/maps/embed?pb=!1m23!1m12!1m3!1d96815.58718897021!2d14.687886745303384!3d40.68526870884758!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!4m8!3e6!4m0!4m5!1s0x133bc2349aa5014f%3A0x73b7127729feca0b!2sVia%20Luigi%20de%20Marzia%2C%207%2C%2084126%20Salerno%20SA!3m2!1d40.6852935!2d14.770294999999999!5e0!3m2!1sit!2sit!4v1733866020383!5m2!1sit!2sit" width="300" height="300" loading="lazy"></iframe>
                    </i>
                </div>

                <div className='col-sm'>
                    <h2>I MIEI SOCIAL <i className="bi bi-people-fill"></i></h2>
                            <div className='row'>
                                <i className="bi bi-instagram footer-first-section-image col-sm"> </i>
                                <p className='col-sm'>INSTAGRAM</p>
                                <br />
                                <i className="bi bi-tiktok footer-first-section-image"></i>
                                <p>I MIEI SOCIAL</p>

                            </div>


               </div>

                <div className='col-sm'>
                    <i className="bi bi-whatsapp footer-first-section-image">
                        <p>TELEFONO</p>
                   </i>

               </div>

            </div>

            {/* Seconda sezione */}
            <div className="footer-bottom">
                <img src={bottomImageUrl} alt="Footer bottom" className="footer-bottom-image" />
                <p className="footer-bottom-text">{bottomText}</p>
            </div>
        </footer>
    );
}
